import React from "react";
import Header from "../Common/Header/Header";
import NavHeader from "../Common/Header/NavHeader/NavHeader";
import Banner from "../components/Banner";
import styled from "styled-components";
import Suggest from "../components/Suggest";

const products = [
  {
    id: 1,
    text: "프로젝트 생성하기",
    url: "https://img-cf.kurly.com/cdn-cgi/image/quality=85,width=400/shop/data/goods/1653038745989l0.jpg",
  },
  {
    id: 2,
    text: "컴포넌트 스타일링하기",
  },
  {
    id: 3,
    text: "Context 만들기",
  },
  {
    id: 4,
    text: "기능 구현하기",
  },
  {
    id: 5,
    text: "프로젝트 생성하기",
  },
  {
    id: 6,
    text: "컴포넌트 스타일링하기",
  },
  {
    id: 7,
    text: "Context 만들기",
  },
  {
    id: 8,
    text: "기능 구현하기",
  },
];

export default function Main(products) {
  function Suggest({ products }) {
    return (
      <div>
        {/* list를 렌더링 할 때는 반드시 key를 넣어줘야 한다 */}
        {products.map((product) => (
          <ProductItem product={product} key={product.id} />
        ))}
      </div>
    );
  }

  return (
    <>
      <Header />
      <NavHeader />
      <Banner />
      <MainWrap>
        <MainTitle>
          <span>이 상품 어때요?</span>
        </MainTitle>
        <MainProduct>
          products={products}
          <MainSwiper></MainSwiper>
        </MainProduct>
      </MainWrap>
    </>
  );
}

export const MainWrap = styled.div``;

export const MainTitle = styled.div``;

export const MainProduct = styled.div``;

export const MainSwiper = styled.div``;

export const ProductItem = styled.div``;
